import React from 'react'

const Card = () => {

    const data = [
        {
          prise:"$ 400,000",
          desc : " Total budget you own", 
        },

        {
          prise:"$ 299,762",
          desc : " Spent month-to-date", 
        },

        {
          prise:"$ 2,874,582",
          desc : " Forecated till month end", 
        },
    ];

  return (
    <div className=' flex gap-20 '>
        {
          data.map((data,index) => {
            return(
              <div>
                <h2>
                  {data.prise}
                </h2>

                <p>
                  {data.desc}
                </p>
              </div>
            )
          })
        }
    </div>
  )
}

export default Card
